    <Container fluid className='container'>
        <Row className="justify-content-md-center">
            {collections.map((item) => (
                <Col s={12} md={4} key={item.id} className=' product'>
                    <Route exact path={`${match.path}`} component={ShopProduct} />
                    <Route path={`${match.path}/:specificProductId`} component={SpecificProduct} />
                    {/* <ShopProduct
                        key={item.id}
                        linkUrl={item.linkUrl}
                        item={item}
                    /> */}
                    {/* </Link> */}
                </Col>
            ))}
        </Row>
    </Container>
);

export default Shop;
